import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import DeliveryCost from './components/DeliveryCost/DeliveryCost';
import PossibleRoutes from './components/PossibleRoutes/PossibleRoutes';
import NewLayout from './components/NewLayout/PossibleRoutes';
import 'typeface-roboto';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <DeliveryCost />
        <PossibleRoutes />
      </header>
    </div>
  );
}

export default App;
